//home.js ->module
import React, { Fragment } from 'react'

//internal images
//import ReactLogo from './assets/images/react_logo.png'

//internal css
var styles =
{
  textAlign: 'center'
}

//import images
import ReactLogo from './assets/images/react_logo.png'

//nested components FROM  main components
import About from './About.js'
import Services from './services.js'
import Contact from './contact.js'


//create home component

function Home()
{
    //VARIABLE
    var cname="Home component"

    var msg=` Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text ever since the 1500s,
    when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap
    into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum
    passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.`
    return(<Fragment>
 
            <h1>{cname}</h1>

            <img src={ReactLogo} style={{width:'30%',height:'200px'}}  />
           
            <p>{msg}</p>

        <hr />
        <About />
        <hr />
        <Services />
        <hr />
        <Contact />

        </Fragment>)
}
export default Home;
